    <style>
        html {
            -webkit-text-size-adjust: 100%%;
            -moz-text-size-adjust: 100%%;
            -ms-text-size-adjust: 100%%;
            text-size-adjust: 100%%;
            font-size: 10px;
        }

        body {
            margin: 0;
           /* background-color: yellow; */
        }

        article,
        aside,
        details,
        figcaption,
        figure,
        footer,
        header,
        main,
        menu,
        nav,
        section,
        summary {
            display: block;
        }

        audio,
        canvas,
        progress,
        video {
            display: inline-block;
        }

        audio:not([controls]) {
            display: none;
            height: 0;
        }

        progress {
            vertical-align: baseline;
        }

        template, [hidden] {
            display: none;
        }

        a {
            text-decoration: none;
            background-color: transparent;
            color: inherit;
        }

        a:active,
        a:hover {
            outline-width: 0;
        }

        abbr[title] {
            border-bottom: none;
            text-decoration: underline;
        }

        ul,
        ol {
            list-style: none;
            padding: 0;
            margin: 0;
        }

        b, strong {
            font-weight: normal;
        }

        h1, h2, h3, h4, h5, h6, p, blockquote {
            margin: 0 auto;
            font-weight: normal;
            font-size: inherit;
        }

        dfn {
            font-style: italic;
        }

        mark {
            background-color: #ff0;
            color: #000;
        }

        small {
            font-size: 80%%;
        }

        sub, sup {
            font-size: 75%%;
            line-height: 0;
            position: relative;
            vertical-align: baseline;
        }

        sub {
            bottom: -.25em;
        }

        sup {
            top: -.5em;
        }

        img {
            border-style: none;
        }

        svg:not(:root) {
            overflow: hidden;
        }

        code, kbd, pre, samp {
            font-family: monospace, monospace;
            font-size: 1em;
        }

        figure {
            margin: 0 auto;
        }

        hr {
            box-sizing: content-box;
            height: 0;
            overflow: visible;
        }

        button, input, select, textarea {
            font: inherit;
            margin: 0;
        }

        optgroup {
            font-weight: bold;
        }

        button, input {
            overflow: visible;
            outline: none;
        }

        button, select {
            text-transform: none;
        }

        button, html [type="button"], [type="reset"], [type="submit"] {
            -webkit-appearance: button;
        }

        button::-moz-focus-inner,
        [type="button"]::-moz-focus-inner,
        [type="reset"]::-moz-focus-inner,
        [type="submit"]::-moz-focus-inner {
            border-style: none;
            padding: 0;
        }

        button:-moz-focusring,
        [type="button"]:-moz-focusring,
        [type="reset"]:-moz-focusring,
        [type="submit"]:-moz-focusring {
            outline: 1px dotted ButtonText;
        }

        fieldset {
            border: 1px solid #c0c0c0;
            margin: 0 2px;
            padding: .35em .625em .75em;
        }

        legend {
            box-sizing: border-box;
            color: inherit;
            display: table;
            max-width: 100%%;
            padding: 0;
            white-space: normal;
        }

        textarea {
            overflow: auto;
        }

        [type="checkbox"], [type="radio"] {
            box-sizing: border-box;
            padding: 0;
        }

        [type="number"]::-webkit-inner-spin-button,
        [type="number"]::-webkit-outer-spin-button {
            height: auto;
        }

        [type="search"] {
            -webkit-appearance: textfield;
            outline-offset: -2px;
        }

        [type="search"]::-webkit-search-cancel-button,
        [type="search"]::-webkit-search-decoration {
            -webkit-appearance: none;
        }

        ::-webkit-input-placeholder {
            color: inherit;
            opacity: .54;
        }

        ::-webkit-file-upload-button {
            -webkit-appearance: button;
            font: inherit;
        }

        *, *:after, *:before {
            -moz-box-sizing: border-box;
            -webkit-box-sizing: border-box;
            box-sizing: border-box;
            vertical-align: top;
        }

        }

        .content {
            margin-top: 1.5rem;
            padding: 0 1.5rem;
            width: 100%%;
            position: relative;
            font-size: 1.7rem;
            line-height: 2.8rem;
            
        }

        .content p {
            font-size: 1.7rem;
            line-height: 2.5rem;
            color: #222629;
            font-weight: 400;
        }

        .content p strong {
            font-weight: 900;
        }

        .content > img {
            display: block;
            width: 100%%;
            height: auto;
        }

        .content > p {
            margin-bottom: 2.6rem;
        }

        .content > blockquote {
            position: relative;
            display: block;
            margin: 3.6rem auto 2.6rem;
            padding: 2.2rem 0 2rem;
            border-top: solid .2rem #eaeaea;
            border-bottom: solid .2rem #eaeaea;
            letter-spacing: .03rem;
            font-size: 3.6rem;
            line-height: 4.3rem;
        }

        .content > blockquote:before {
            content: "";
            font-family: "yenisafak-spor", monospace;
            position: absolute;
            top: -1.8rem;
            left: 3rem;
            padding: 0 1rem;
            font-size: 2.8rem;
            background: #fff;
            color: #eaeaea;
        }

        .content > blockquote small {
            display: block;
            padding-top: 1rem;
            font-weight: normal;
            font-size: 1.2rem;
            line-height: 1.6rem;
            color: #8c8c8c;
        }

        .content > b, .content > strong {
            font-weight: bold;
        }

        .content > br {
            content: "";
            display: block;
            margin-bottom: 1rem;
        }

        .content ol, .content ul {
            position: relative;
            border: solid .1rem #e6e6e6;
            padding: 3rem 2rem;
            margin: 2rem auto;
            background: #52c3bd;
            background: rgba(82, 195, 189, .05);
            -webkit-border-radius: .3rem;
            -moz-border-radius: .3rem;
            border-radius: .3rem;
        }

        .content ol li, .content ul li {
            display: block;
            padding-bottom: 2rem;
            font-family: "Abril", monospace;
        }

        .content > p > a, .content > a {
            color: #07e;
            max-width: 100%%;
            overflow: hidden;
            text-overflow: ellipsis;
        }

        .content > p > a:hover, .content > a:hover {
            text-decoration: underline;
        }

        .content > iframe {
            width: 100%% !important;
        }

        .content iframe[src*="youtube"] {
            width: 100%% !important;
            height: 36rem !important;
        }

        figure figcaption {
            font-family: "Helvetica", monospace;
            padding: 0 1.5rem 1.5rem;
        }

        figure figcaption h3 {
            font-size: 2rem;
            font-weight: 500;
        }

        figure figcaption span {
            color: #c8d0d4;
            font-size: 1.5rem;
            line-height: 2rem;
        }

        figure figcaption .photo {
            margin-bottom: 1.5rem;
        }

        figure figcaption .photo p, figure figcaption .photo span {
            width: auto;
            font-size: 1.4rem;
            color: #676f77;
            line-height: 2rem;
            display: inline-flex;
        }

        figure figcaption .photo span {
            color: #9ca5ad;
            margin-left: .5rem;
        }

        figure .icon-media-video:before {
            content: "";
            font-size: 2.88rem;
            line-height: 4.8rem;
            width: 4.8rem;
            height: 4.8rem;
        }

        figure .icon-media-gallery:before {
            content: "";
            font-size: 2.88rem;
            line-height: 4.8rem;
            width: 4.8rem;
            height: 4.8rem;
        }

        figure.inside {
            width: calc(100%% + 3rem);
            margin-left: -1.5rem;
            position: relative;
            color: #222629;
            background: #000;
        }

        figure.inside .title {
            font-family: "Helvetica", monospace;
            font-size: 2.4rem;
            line-height: 2.8rem;
            margin: 1.5rem auto;
            color: #fff;
            font-weight: bold;
        }

        figure.inside .image {
            position: relative;
            width: auto !important;
        }

        figure.inside .image img {
            max-width: 100%%;
            height: auto;
        }

        figure.inside .image .icon-group {
            width: auto;
            position: absolute;
            left: 1.5rem;
            bottom: .5rem;
            padding: 0 1.5rem;
            color: #fff;
            -webkit-border-radius: .4rem;
            -moz-border-radius: .4rem;
            border-radius: .4rem;
            z-index: 99999;
            background: #000;
            border: solid #b7b7b7 .2rem;
            font-size: 1.5rem;
        }

        figure.inside .image .icon-group strong {
            padding-right: 1rem;
            line-height: 4.8rem;
            font-family: "Helvetica", monospace;
            font-weight: 700;
        }

        figure.inside .image .icon-group span {
            font-family: "Helvetica", monospace;
            padding-right: 1rem;
            line-height: 4.8rem;
        }

        figure.inside .image.shadow:after {
            content: "";
            position: absolute;
            bottom: 0;
            left: 0;
            right: 0;
            height: 70%%;
            background: -moz-linear-gradient(top, transparent 0, rgba(0, 0, 0, .6) 50%%, #000 100%%);
            background: -webkit-linear-gradient(top, transparent 0, rgba(0, 0, 0, .6) 50%%, #000 100%%);
            background: linear-gradient(to bottom, transparent 0, rgba(0, 0, 0, .6) 50%%, #000 100%%);
        }

        figure.inside .video {
            position: relative;
        }

        figure.inside .video .image.hidden {
            position: absolute;
            pointer-events: none;
            width: 100%%;
            height: 0;
        }

        figure.inside .info {
            margin: 1rem auto;
            font-size: 1.3rem;
            line-height: 1.6rem;
            color: #90949d;
        }

        figure.inside .info .item {
            position: relative;
            padding-right: 2.2rem;
        }

        figure.inside .info .item:after {
            content: "";
            position: absolute;
            top: 50%%;
            right: 1rem;
            height: .2rem;
            width: .2rem;
            background: #90949d;
            -webkit-border-radius: .2rem;
            -moz-border-radius: .2rem;
            border-radius: .2rem;
        }

        figure.inside .info .item:last-child:after {
            content: none;
        }

        figure.inside .action {
            margin: 1rem auto;
            font-family: "Abril", monospace;
            font-size: 1.2rem;
            line-height: 1.6rem;
            color: #ccc;
        }

        figure.inside .action .item {
            position: relative;
            padding-right: 1rem;
        }

        figure.inside .action .item i {
            display: inline-block;
            font-size: 1.4rem;
            line-height: 1.6rem;
        }

        figure.inside .action .item span {
            display: inline-block;
            padding-top: .2rem;
            line-height: 1.4rem;
            margin: 0 1rem;
        }

        figure.inside .spot {
            font-family: "Abril", monospace;
            font-size: 1.3rem;
            line-height: 1.7rem;
            color: #666;
            margin-top: 1rem;
            margin-bottom: .5rem;
        }

        figure.inside .description a {
            color: #07e;
            width: 100%%;
            overflow: hidden;
            text-overflow: ellipsis;
        }

        figure.inside .description strong {
            font-family: "Abril", monospace;
            color: #000;
        }

        figure.inside[data-media="news"] .image img {
            width: 100%%;
            height: auto;
        }

        figure.inside[data-media="image"],
        figure.inside[data-media="video"],
        figure.inside[data-media="gallery"] {
            margin-bottom: 2.8rem;
        }

        figure.inside[data-media="rich"] {
            margin-bottom: 2rem;
        }

        figure.inside[data-media="rich"] .order {
            color: #5dc3e9;
        }

        figure.inside[data-media="rich"] .embed img {
            display: block;
            overflow: hidden;
            width: 100%%;
            height: auto;
        }

        figure.inside-news {
            width: 100%%;
        }

        figure.inside-news .image img {
            width: 100%%;
        }

        .note {
            width: 100%%;
            background: #f4feff;
            border: solid #20bbdc .2rem;
            display: block;
            padding: 2.2rem;
            margin-bottom: 2rem;
            border-radius: .5rem;
            font-family: "Helvetica", monospace;
        }

        .note span {
            color: #222629;
            font-size: 1.9rem;
            line-height: 2rem;
        }

        .note strong {
            font-weight: 500;
        }

        .tag {
            width: 100%%;
            background: none;
        }

        .tag ul {
            margin: 0;
            padding: 0;
            background: none;
            border: none;
        }

        .tag ul li {
            width: auto;
            display: inline-flex;
            margin-right: .6rem;
        }

        .tag ul li a {
            padding: 0 1.5rem;
            border: solid #d2d7e0 .1rem;
            display: block;
            font-size: 1.5rem;
            line-height: 4.5rem;
            font-family: "Helvetica", monospace;
            border-radius: .3rem;
            color: #98a5bb;
        }

        body {
            font-family: "Abril", monospace;
            font-size: 10px;
        }

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
    </style>
    <meta name="viewport" content="width=device-width, user-scalable=no, initial-scale=1.0">
    <meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
</head>
<body>
<div id="news-detail" class="content">
    {HtmlDataLoadPoint}
</div>
</body>
</html>
